/**
 * Returns feature for township specified by name.
 * @param {string} name
 */
import {Feature, FeatureCollection, Position} from "./geojson";

/**
 * Returns a feature describing a township by name.
 * @param {string} name
 * @return {Feature}
 */
export const getTownshipByName = (name: string): Feature | null => {
  return Townships.features.find((feature: Feature) => {
    return String(feature.properties.name).toLowerCase() === name.toLowerCase();
  }) || null
}

/**
 * Returns features describing townships, excludes township by name.
 * @param {string} name
 * @return {Feature[]}
 */
export const excludeTownShipByName = (name: string): Feature[] => {
  return Townships.features.filter((feature: Feature) => {
    return String(feature.properties.name).toLowerCase() !== name.toLowerCase();
  });
}

